import React from "react";
import "./SearchImage.scss";
import { withRouter } from "react-router-dom";

const SearchImage = ({searchImageById}) => {
  return (
    <div className="searchimage">
      <img src={searchImageById.links[0].href} alt="searchimage" />
      <span>{searchImageById.data[0].title}</span>
      <span>{searchImageById.data[0].description}</span>
    </div>
  );
};

export default withRouter(SearchImage);
